class Solution:
    def findTheDifference(self, s: str, t: str) -> str:
        s, t = sorted(s), sorted(t)
        #index = t.find(s) + len(s)
        for i, j in enumerate(s):
            if j != t[i]: 
                return t[i]
        
        return t[-1]
        
